import React from "react";
import Notes from "./Note";
import noteDetails from "./noteDetails";

function newNotes(props) {
  return (
    <noteDetails
      key={props.key}
      nTitle={props.title}
      nContent={props.content}
    />
  );
}

function Note() {
  return (
    <div className="note">
      {Notes.map(newNotes)}
      <h1>This is Note Title!</h1>
      <p> This is the note content</p>
    </div>
  );
}

export default Note;
